import React, { useState } from 'react';
import './App.css';
function App() {
  let products=['tooth paste','tooth brush','denal floss','mouth guard'];
  return (
    <div className='App'>
     <ul>
      {products.map((prod,index)=><li key={index}>{prod}</li>)}
     </ul>
    </div>
  )
}
export default App
